// pages/TUMApp.js
import React, { useState } from 'react';

const TUMApp = (props) => {
  const [count, setCount] = useState(0);

  return (
    <div>
      <h1>Welcome to {props.course}</h1>
      <p>Number of times clicked: {count}</p>
      <button onClick={() => setCount(prevCount => prevCount + 1)}>
        Click me!
      </button>
    </div>
  );
};

export default TUMApp;
